package selectionstatments;

public class casethree {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=10;
		switch(x+1)
		{
		case 10+1:
			System.out.println("printed");
		
		case 20+30+40+50+60:
			System.out.println("110");
		case 20+40:
			System.out.println("60");
		}

	}

}
